import React, {useState} from "react";
import {Row, Col, Card, CardBody, CardHeader,} from "reactstrap";
import {ChevronDown, ChevronRight} from "react-feather";
import PlusButton from "../../../components/buttons/plusButton";
import EditButton from "../../../components/buttons/editButton";
import DeleteButton from "../../../components/buttons/deleteButton";
import Accordion from "../../../components/accordion/Accordion";

function AccordionItem1(props) {
    console.log(props)
    const [open, setOpen] = useState(false);

    function handleOpen() {
        setOpen(!open)
    }

    function Chevron() {
        if (props.data) {
            if (!open) {
                return <ChevronRight size={18} className="mr-2" onClick={() => handleOpen()}/>
            }
            return <ChevronDown size={18} className="mr-2" onClick={() => handleOpen()}/>
        }
        return <div></div>
    }

    return (
        <Accordion.AccordionItem
            render={() => (
                <CardHeader className="border-bottom-grey border-bottom-lighten-3">
                                 <span aria-expanded="true" aria-disabled="false" aria-controls="1"
                                       className="primary mx-0 cursor-pointer">
                                    <h5>
                                        <Chevron/>{" "}
                                        <span>{props.data.name}</span>
                                    </h5>
                                 </span>
                </CardHeader>
            )}
        >
            <CardBody>
                Aenean eget leo vel lorem tincidunt tempor sit amet non ex. Aenean porta, velit ut efficitur
                fringilla, enim est suscipit augue, in porta ex nisi quis est. Phasellus ut odio in dolor
                eleifend tincidunt eget id tellus.
            </CardBody>
        </Accordion.AccordionItem>
    )


};


function categoryTable(props) {
    if (props.data.length > 0) {
        return (
            <Accordion>
                {props.data.map((value, index) => {
                    console.log(value)
                    return <Accordion.AccordionItem
                        render={() => (
                            <CardHeader className="border-bottom-grey border-bottom-lighten-3">
                                 <span aria-expanded="true" aria-disabled="false" aria-controls="1"
                                       className="primary mx-0 cursor-pointer">
                                    <h5>
                                        <Chevron/>{" "}
                                        <span>{value.name}</span>
                                    </h5>
                                 </span>
                            </CardHeader>
                        )}
                    >
                        <CardBody>
                            Aenean eget leo vel lorem tincidunt tempor sit amet non ex. Aenean porta, velit ut efficitur
                            fringilla, enim est suscipit augue, in porta ex nisi quis est. Phasellus ut odio in dolor
                            eleifend tincidunt eget id tellus.
                        </CardBody>
                    </Accordion.AccordionItem>
                })}
            </Accordion>
        );

    } else {
        return <div></div>
    }

}

export default categoryTable;
